import React from 'react';
import { View, Text, StyleSheet, ScrollView, TouchableHighlight, TouchableOpacity } from 'react-native';
import { useNavigation } from '@react-navigation/native';
import Icon from 'react-native-vector-icons/FontAwesome';

export default function Dashboard() {
  const navigation = useNavigation();

  const menuItems = [
    { name: 'Original Recipe Chicken', price: '$8.99' },
    { name: 'Chicken Tenders', price: '$7.49' },
    { name: 'Zinger Burger', price: '$6.99' },
    { name: 'Mashed Potatoes', price: '$2.99' },
    // Add more KFC menu items with prices as needed
  ];

  // ... Rest of your code ...

  return (
    <View style={styles.container}>
      {/* Back button */}
      <TouchableOpacity style={styles.backButton} onPress={() => navigation.goBack()}>
        <Icon name="arrow-left" size={24} color="#000" />
      </TouchableOpacity>

      {/* Rest of your component */}
      {/* ... */}
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    marginTop: 19,
    paddingHorizontal: 20,
    justifyContent: 'center', // Center items vertically
  },
  // ... Rest of your styles ...
  backButton: {
    position: 'absolute',
    top: 20,
    left: 20,
    zIndex: 1,
  },
});
